import React from 'react'
import data from "./data"

export const Products = () => {
  return (
    <div>
        {
            data.map((product)=>{
                
                return(
                    <div>
                    <div style={{
                        width:"300px",
                        height:"400px",
                        border:"2px solid red"
                    }}>
                        <div>
                            <img src={product.thumbnail} alt="product" style={{width:"50%"}}/>
                        </div>
                        <div>
                            <p>{product.title}</p>
                            <p>{product.price}</p>
                        </div>
                    </div>

                    </div>
                )
            })
        }
    </div>
  )
}
